    const apiKey = process.env.REACT_APP_GOOGLE_MAPS_API_KEY;

    return (
        <LoadScript googleMapsApiKey={"AIzaSyAoLNH-Qogucow2mD4n3MmzKbc7LygJXik"}>
            <GoogleMap
                mapContainerClassName="GoogleMap"
                mapContainerStyle={containerStyle}
                center={center}
                zoom={10}
            >
                {/* Markers and other map elements go here */}
            </GoogleMap>
        </LoadScript>
    )
}



export default MapView;
